import React from 'react'
import { H1 } from '../../styles/TextStyles';
import MyDescription from './MyDescription'

function Home() {
    return (
        <>
            <Wrapper>

                <Bulb1 src="./images/Vector.svg" />
                <Bulb2 src="./images/Vector2.svg" />
                <ContentWrapper>
                    <ComputerWork src="./images/computer-work.svg" />
                    <TextWrapper>    
                        <Title>Hi.<br/>Welcome to<br/>My Website!</Title>
                    </TextWrapper>
                </ContentWrapper>
            </Wrapper>
        </>
    )
}

export default Home;

const Wrapper = styled.div`
    height: 100%;
`


const ComputerWork = styled.img`
    width: 568px;
    height: 420px;
    left: calc(50% - 568px/2 - 202.5px);
    justify-content: center;
    align-content: center;
`

const W = styled.div`

`

const Bulb1 = styled.img`
    position: absolute;
    left: 0%;
    top: 0%;
    width: 100%;
    z-index: -10;
`
const Bulb2 = styled.img`
    position: absolute;
    left: 0%;
    top: 0%;
    width: 100%;
    z-index: -100;
`

const ContentWrapper = styled.div`
    display: grid;
    position: realtive;
    max-width: 1234px;
    margin: 0 auto;
    padding: 200px 30px;
    grid-column-gap: 20px;
    grid-template-columns: 50% 50%;

`
const TextWrapper = styled.div`
    max-width: 360px;
    display: grid;
    grid-gap: 30px;
    justify-content: center;
    align-content: center;
`

const Description = styled(BodyMain)``

const Title = styled(H1)`
    color: white;
`
